/**
@author:- Anurag
@email:- anurag@c3ihub.iitk.ac.in

UserManager contract is used to manage mapping functionality for id to voter and candidate address, and to manage election verifier, approver, member.
The contract owner and admin have the authority to update voter, candidate, verifier, approver, member.

*/

// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.16;

import "./DataTypes.sol";
import "./Enums.sol";
import "./VotingCommon.sol";
import "./UserStorage.sol";

contract UserManager is VotingCommon{

    event VoterAdded(bytes32 voterId);


    // constructor to set the initial value of the contract
    constructor(address _admin, address _manager) VotingCommon(_admin, _manager){}

    // Data layer
    UserStorage public userStorage;
    address public userStorageAddress;

    function loadUserStorage(address _userStorageAddress) public {
        userStorageAddress = _userStorageAddress;
        userStorage = UserStorage(userStorageAddress);
    }

    // function to add designation value
    function addDesignation(string memory _designation) public {
        userStorage.addDesignation(_designation);
    }


    // function to add role value
    function addRole(string memory _role) public {
        userStorage.addRole(_role);
    }

    // function to add posiiton value
    function addPosition(string memory _position) public {
        userStorage.addPosition(_position);
    }

    // function to get designation value
    function getDesignationValue(string memory _designation) public view returns(uint) {
        return userStorage.getDesignationValue(_designation);
    }

    // function to get role value in int
    function getRoleValue(string memory _role) public view returns(uint) {
        return userStorage.getRoleValue(_role);
    }

    // function to get position value in int
    function getPositionValue(string memory _position) public view returns(uint) {
        return userStorage.getPositionValue(_position);
    }


    /*
        USER OPERATIONS
    */

    // function for add user detail
    function addUser(bytes32 _userId, address _userAddress) public {
        userStorage.addUser(_userId, _userAddress);
    }

    // function for update user detail
    function updateUser(bytes32 _userId, address _userAddress) public {
        userStorage.updateUser(_userId, _userAddress);
    }

    // function for delete user detail
    function deleteUser(bytes32 _userId) public {
        userStorage.deleteUser(_userId);
    }

    // function for get user detail
    function getUserAddress(bytes32 _userId) public view returns(address) {
        return userStorage.getUserAddress(_userId);
